/* export const getNastavnici = async () => {
  const nast = await fetch('http://localhost:3001/nastavnici');
  const response = await nast.json();
  return {
    type: 'GET_NASTAVNICI',
    data: response,
  };
}; */
function loadData(userId) {
  return (dispatch) =>
    fetch('http://localhost:3001/nastavnici') // Redux Thunk handles these
      .then((res) => res.json())
      .then(
        (data) => dispatch({ type: 'LOAD_DATA_SUCCESS', data }),
        (err) => dispatch({ type: 'LOAD_DATA_FAILURE', err })
      );
}
